VALUES ('3760234440061', 'Glace chocolat pistache', 'Glace au chocolat (35,7%) : eau, chocolat en poudre (3,9%) (sucre, poudre de cacao), glucose, lactose, matière grasse laitière, sucre, protéines de lait, émulsifiant (mono et diglycérides d\'acides gras), épaississants (farine de graines de caroube, gomme de guar, carraghénanes). Glace pistache (35,7%) : eau, sucre, lactose, glucose, matière grasse laitière, préparation aromatisée de pâte de pistache (sirop de sucre, pâte de pistache (0,6%), arôme naturel), protéines de lait, émulsifiant (mono et diglycérides d\'acides gras), épaississants (farine de graines de caroube, gomme de guar, carraghénanes), colorants (E 141, curcumine). Gaufrette (15%) : farine de froment (gluten), sucre, huile végétale raffinée (coco), émulsifiant (lécithine de soja), sel, colorant caramel (E 150a). Enrobage (12%) : graisse végétale (noix de coco), sucre, pâte de cacao, graisse végétale totalement hydrogénée (noix de coco), poudre de cacao maigre, émulsifiant (lécithine de soja). Nougatine de noisettes (1 ,6%) : sucre, noisettes (0,5%), sirop de sucre, sirop de sucre caramélisé.', 'https://static.openfoodfacts.org/images/products/376/023/444/0061/front_fr.4.400.jpg', '15', '11', '35', '25', '', '3.1', '0.1', '0.0393700787401575', '', '1');

