VALUES ('3760235010287', 'Theralica Minceur - Soupe Thaï 7 Sachets - Theralica', 'Protéines de lait (émulsifiant : lécithine de tournesol), arômes, exhausteur de goût : glutamate de sodium, épices (citronnelle, curcuma, poivre de Cayenne, coriandre, gingembre, ail) (3,9%), fructose, poivron rouge, sel, champignon de Paris, maltodextrine, jus concentré de citron, vitamines (C, B3, E, B5, B6, B2, BI, A, B9, B8, BI 2), épaississant : gomme xanthane, antiagglomérant : dioxyde de silicium. Contient : lait. UTILISATION Ajouter 25 g de poudre à 200 mL d\'eau et mélanger jusqu\'à dispersion complète. Chauffer 1 minute au four à micro-ondes. INFORMATIONS OGM (règlements (CE) NOI 829/2003 et (CE) NOT 830/2003) Ce produit n\'est pas soumis à l\'étiquetage OGM. CONDITIONS DE STOCKAGE Stocker dans un endroit frais et sec. CONSERVATION 24 mois dans son emballage d\'origine fermé et dans des conditions normales de stockage.', '', '2.1', '0.9', '12.3', '9.5', '1.6', '70', '2.64', '1.03937007874016', '', '0');

