INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3760238991415', '8 macarons gourmands', 'Coque macaron : poudre d\'_amandes_, sucre cristal, sucre glace, blanc d\'_œuf_ (blanc d\'_œuf_ liquide, stabilisants : E412, E415), blanc d\'_œuf_ sec en poudre (épaississant : gomme xanthane E415, acidifiant : E330, agent foisonnant : E1505), colorant E163, E120, E160a, E161B et E141. Encre de seiche poudre. Garniture macaron : Café : crème (crème (_lait_), stabilisants : carraghénanes, cellulose), chocolat blanc 35 % (sucre, beurre de cacao, poudre de _lait_ entier, lactosérum en poudre, émulsifiant : lécithine de _soja_), extrait de vanille), café soluble, trablit, gélifiant : agar-agar, E406, poudres d\'_amandes_. Cassis : crème (crème (_lait_), stabilisants : carraghénanes, cellulose), chocolat blanc 35 % (sucre, beurre de cacao, poudre de _lait_ entier, lactosérum en poudre, émulsifiant : lécithine de _soja_, extrait de vanille), café soluble, trablit, gélifiant : agar-agar E406, poudres d\'_amandes_. Citron vert : crème (_lait_), chocolat blanc (sucre, beurre de cacao, poudre de _lait_ entier, lactose, lactosérum en poudre, émulsifiant : lécithine de _soja_, extrait de vanille), purée de citron vert, jus de citron vert, zeste de citron vert, gélifiant : agar-agar E406, poudre d\'_amandes_. Fraise : confiture de fraises (fraises 60 %, sucre, eau, gélifiant E990i).', 'https://static.openfoodfacts.org/images/products/376/023/899/1415/front_fr.16.400.jpg', '25', '20', '49', '40', '', '9.6', '0.18', '0.0708661417322835', '', '0');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3760238991453', '8 macarons d\'hiver', 'Poudre d\'_amandes_, sucre, sucre glace (saccharose, fécule de pomme de terre), blanc d\'_œuf_ liquide (blanc d\'_œuf_ liquide, épaississant : E412, E415), blanc d\'_œuf_ en poudre (blanc d\'_œuf_, épaississant E415, acidifiant E330, agent foisonnant E1505), colorant caramel E150c, colorant orange E160a, cacao en poudre dégraissé, colorant E141, cannelle en poudre, gousse de vanille. Garniture macaron marron glacé : beurre (_lait_), pâte de marrons (châtaignes, eau), crème de marron (purée de châtaignes, sucre, sirop de glucose-fructose, arôme naturel de vanille), marrons entiers. Garniture pain d\'épice s: pain d\'épices (farine de _blé_, miel, sucre, levure, sucre vanille, crème (_lait_), épices (gingembre, cannelle, girofle, muscade), _beurre_ (lait) , oranges confites (écorces d\'oranges, sirop de glucose-fructose, saccharose, correcteur d\'acidité E330, conservateur : E202, E220 (sulfites), crème anglaise (_lait_ partiellement écrémé, sucre, jaunes d\'_œufs_ sucrés, épaississants : amidon transformé de maïs, carraghénanes, homme de xanthane, arôme vanille, colorant : caroténoïdes (_soja_)), zestes d\'oranges, cannelle en poudre. Garniture praliné : crème UHT (crème (_lait_), stabilisants : carraghénanes, cellulose), chocolat (sucre, pâte de cacao, _beurre_ de cacao, émulsifiant : lécithine de soja, vanilline), praliné _amandes_ _noisettes_ (sucre, _amandes_, _noisettes_, lécithine de _soja_). Garniture mandarine/pamplemousse : crème (_lait_), chocolat blanc (sucre, beurre de cacao, poudre de _lait_ entier, lactose, lactosérum en poudre, émulsifiant : lécithine de _soja_, extrait de vanille), purée de mandarine, purée de pamplemousse, gélifiant : agar-agar E406, poudre d\'_amandes_.', 'https://static.openfoodfacts.org/images/products/376/023/899/1453/front_fr.4.400.jpg', '25', '', '49', '', '', '9.6', '0.18', '0.0708661417322835', '', '1');

