VALUES ('3760239140256', 'Crème glacée au goût de tiramisu', 'lait frais entier pasteurisé de haute qualité, lait éc réhydraté, sauce de café 15% (sucre, sirop de glucose, eau, ce poudre 3,570, amidon modifié, huile de tournesol, lait conc arômes, stabilisant: agar-agar), crème de lait 10%, sucre, lait éc en poudre, sirop de glucose, dextrose, beurre 2,5%, pâte de sat cre, oeufs frais pasteurisés 28Z, Marsala DOC, amidon de riz, arômes, alcool), cacao en poud e et protéines de lait, émulsifiant: mono- et diglycérides d\'acides gras, stabilisants: farine de g oube, gomme de guar, carraghénanes, curcuma à proprieté colorante. it élaboré dans une usine qui utilise fruits à coque et soya. DIENTS: pasteurized high quality fresh whole milk rehydrated skim milk, coffee sauce 15% se syrup, water, coffee powder 3.570. modified starch, sunflower oil, concentrated milk, zer: agar-agar), milk cream 10%, sugar, skim milk powder, glucose syrup, dextrose, butte lione paste 2% (sugar, fresh pasteurized eggs 28%, DOC Marsala, rice starch, flavors, alcohol), er IZ, lactose and milk proteins, emulsifier: mono- and diglycerides of fatty acids, stabilizers: gum, guar gum, carrageenans. turmeric With coloring properties. factured in a facility that uses tree nuts and soy. leche entera fresca pasteurizada de alta calidad, leche desnatada rehidratada, siro 15% (azücar, jarabe de glucosa, agua, café en polvo 3,5%, almidôn modificado, aceite de gi concentrada, aromas, estabilizante: agar-agar), crema de leche 10%, azücar, leche desnatac , jarabe de glucosa, dextrosa, mantequilla 2,5%, pasta de sabayon 2% (azücar, huevos fre urizados 28%, Marsala DOC, almidôn de arroz, aromas, alcohol), cacao en polvo 1%, lactc inas de la leche, emulsionante: mono- y diglicéridos de acidos grasos, estabilizadores: harin las de algarroba, goma de guar, carragenanos, cürcuma con propiedades colorantes. acido en una instalacién que hace uso de frutos de céscara y soja.', 'https://static.openfoodfacts.org/images/